import React from "react";
import { Route,Redirect} from "react-router-dom";

const ProtectedRoutes = ({ isAuthenticated}) => {
    return (
      <Route
        render={() =>
          isAuthenticated ? <Redirect to='/welcome'/> : <Redirect to="/login" />
        }
      />
    )
}


export default ProtectedRoutes
